import React, { Component } from 'react'
import ListOfColorPlatter from './ListOfColorPlatter';

export class DiffrentComponent extends Component {
   constructor(props) {
     super(props);
     this.state = {
         data :[]
     }
   }
   componentDidMount = () => {
      console.log("hii",this.props.colorPlatter)
     this.setState({data:this.props.colorPlatter})

   }
   onDeleteCurrentColor = () => {

     this.setState({data:this.state.data['0'].data.splice(this.state.data['0'].data.length-1,1)})
     console.log(this.state.data['0'].data.length)
   }

  render() {
    return this.props.colorPlatter.map((data, i)=> (
      <div>
        <h3>{data.title}</h3>
      <div className="listOfColor">
       <ListOfColorPlatter  newPlate = {data.data}></ListOfColorPlatter>
       <div onClick = {this.onDeleteCurrentColor} style={deleteBUtton}>hello</div>
      </div>
    </div>
    )) 



  }
}
const deleteBUtton = {
  width: "12%",
  marginTop: "2%",
  marginLeft: "2%",
  padding:"4%",
  border: "1px solid transparent",
  borderRadius: "5px",
  display: "flex",
  position: "relative",
  justifyContent:"center",
  alignItems: "center",
  backgroundColor:'lightgreen'

}

export default DiffrentComponent;
